- Taylor came away with no Grammy awards this time, the night when she should have won 'em all.

Instead she awarded us with a holy war of words of wonder from her burning songbook of love.

RED RULES!

- JANUARY 28 : HAPPY UP HELLY AA!

Scotland: UPHELLYAA. Norse galley burned in Viking sacrifice to sun.

For 24 hours, on the last Tuesday of January, the town of Lerwick goes more than a little mad.

'There will be no postponement for weather'. That's a defiant boast by Shetland's biggest fire festival, considering it's held in mid-winter on the same latitude as southern Greenland. But it's true: gales, sleet and snow have never yet stopped the 'Up Helly Aa' guizers of Lerwick from burning their Viking galley - and then dancing the dawn away.

Up Helly Aa is a lot more than a sub-arctic bonfire and booze-up. It's a superb spectacle.

So the time is more than right to warm your cold aching heart next to Taylor's hot headbanging fire away!

Swifty is a headbanger!
